import { useMemo } from "react";
import {
  ConnectionProvider,
  WalletProvider,
} from "@solana/wallet-adapter-react";
import { WalletAdapterNetwork } from "@solana/wallet-adapter-base";
import {
  WalletModalProvider,
  WalletMultiButton,
} from "@solana/wallet-adapter-react-ui";
import { clusterApiUrl } from "@solana/web3.js";
import './Header.css'

// Default styles that can be overridden by your app
import "@solana/wallet-adapter-react-ui/styles.css";

function BuildWallet() {
  // The network can be set to 'devnet', 'testnet', or 'mainnet-beta'.
  const network = WalletAdapterNetwork.Devnet;
  // You can also provide a custom RPC endpoint.
  const endpoint = useMemo(() => clusterApiUrl(network), [network]);

  const wallets = useMemo(
    () => [
      // if desired, manually define specific/custom wallets here (normally not required)
      // otherwise, the wallet-adapter will auto detect the wallets a user's browser has available
    ],
    [network],
  );

  return (
    <ConnectionProvider endpoint={endpoint}>
      <WalletProvider wallets={wallets} autoConnect>
        <WalletModalProvider>
          <WalletMultiButton />
        </WalletModalProvider>
      </WalletProvider>
    </ConnectionProvider>
  )
}

function BuildLogoAndSearchBar() {
  return(
    <div className="headerCol">
      <div id="logo">
        <img src="https://cdn.discordapp.com/attachments/1192910320730128504/1242883842210136064/Untitled_Artwork_63.png?ex=664f7547&is=664e23c7&hm=65a1bb75d5ebb88024ec704f008b6d0fc414d7860dbcf74c49f02b480b910a37&" alt="Cycle Logo" onClick={event =>  window.location.href='/'}>
        </img>
      </div>
      <div id="searchBar">
        <input type="text" placeholder="discover collections..."></input>
      </div>
    </div>
  )
}

function BuildMenu() {
  return (
    <nav className="headerCol"> 
      <div id="menu">
        <ul>
          <li>
            COLLECTIONS
          </li>
          <li onClick={event =>  window.location.href='/create'}>
            CREATE
          </li>
          <li>
            DASHBOARD
          </li>
          <li>
            ABOUT
          </li>
          <li>
            FAQ
          </li>
        </ul>
      </div>
    </nav>
  )
}

function Header() {

  return (
    <div id="navBar">
      <BuildLogoAndSearchBar />
      <BuildMenu />
      <BuildWallet />
    </div>
  );
}

export default Header;
